import React, { Component, useState } from "react";
import axios from "axios";

class Temp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      countryName: "",
      cityName: "",
      lat: null,
      lon: null,
    };
  }
  getGeoInfo = () => {
    axios
      .get(
        "api.openweathermap.org/data/2.5/weather?lat={lat}&lon={lon}&appid=8f61a1e09924a4c204d0927cfe0ff964"
      )
      .then((response) => {
        let data = response.data;
        this.setState({
          countryName: data.country_name,
          cityName: data.city,
          latitude: data.latitude,
          longitude: data.longitude,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  };
  componentDidMount() {
    this.getGeoInfo();
  }
  render() {
    return (
      <div>
        <p>Country Name: {this.state.countryName}</p>
        <p>City Name: {this.state.cityName}</p>
        <p>Latitude: {this.state.latitude}</p>
        <p>Latitude: {this.state.longitude}</p>
      </div>
    );
  }
}

export default Temp;
